package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import org.springframework.format.annotation.DateTimeFormat;import java.io.Serializable;import java.util.Date;/** * @User * @用户(user_status) * @version : Ver 1.0 */@TableName("decision_field")public class DecisionField implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:用户表id	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	private String type;	private String name;	private String defaultValue;	private String range;	private String instruction;	public DecisionField(){	}	public DecisionField(		Long id	){		this.id = id;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getType() {		return type;	}	public void setType(String type) {		this.type = type;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getDefaultValue() {		return defaultValue;	}	public void setDefaultValue(String defaultValue) {		this.defaultValue = defaultValue;	}	public String getRange() {		return range;	}	public void setRange(String range) {		this.range = range;	}	public String getInstruction() {		return instruction;	}	public void setInstruction(String instruction) {		this.instruction = instruction;	}}